import React, { useState } from 'react';
import { View, StyleSheet, Picker, TextInput } from 'react-native';

const styles = StyleSheet.create({
  input_nasc_dia: {
    height: 60,
    backgroundColor: '#FFF',
    borderRadius: 10,
    marginBottom: 8,
    paddingHorizontal: 24,
    maxWidth: 110,
  },
});

const dias = Array.from({ length: 31 }, (_, index) => (index + 1).toString());

const MeuComboBox = () => {
  const [dia, setDia] = useState('');

  const handleDiaChange = (texto) => {
    setDia(texto);
  };

  return (
    <View>
      <TextInput
        style={styles.input_nasc_dia}
        placeholder="Dia"
        value={dia}
        onChangeText={handleDiaChange}
      />
      <View style={styles.input_nasc_dia}>
        <Picker
          selectedValue={dia}
          onValueChange={handleDiaChange}
          style={{ height: 50 }}
        >
          {dias.map((dia) => (
            <Picker.Item key={dia} label={dia} value={dia} />
          ))}
        </Picker>
      </View>
    </View>
  );
};

export default MeuComboBox;
